description:
Nar journalisten Roweenas barndomsvan hittas mordad riktas
misstankarna mot reklammagnaten Harrison Hill som hon traffade
via en natchat. Rowena ar overtygad om att Hill ar den skyldige
och bestammer sig for att gora sin egen undersokning och infiltrerar
reklambranschen med hjalp av medarbetaren Miles Haley...
Med Halle Berry och Bruce Willis.
